import numpy as np
import matplotlib.pyplot as plt
from pandas.tools.plotting import parallel_coordinates
from paretofrontFeasible import paretofrontFeasible

import matplotlib.colors as color
import matplotlib.ticker as ticker

def parallel_coordinates(data_sets, colors=None, columNames=None, alpha=None):
    dims = len(data_sets[0])
    x    = range(dims)
    fig, axes = plt.subplots(1, dims-1, sharey=False)

    if colors is None:
        colors = ['r-']*len(data_sets)
    
    # Calculate the limits on the data
    min_max_range = list()
    for m in zip(*data_sets):
        mn = min(m)
        mx = max(m)
        if mn == mx:
            mn -= 0.5
            mx = mn + 1.
        r  = float(mx - mn)
        min_max_range.append((mn, mx, r))

    # Normalize the data sets
    norm_data_sets = list()
    for ds in data_sets:
        nds = []
        for dimension, value in enumerate(ds):
            v = (value - min_max_range[dimension][0]) / min_max_range[dimension][2]
            nds.append(v)
        norm_data_sets.append(nds)
        
    data_sets = norm_data_sets

    # Plot the datasets on all the subplots
    for i, ax in enumerate(axes):
        for dsi, d in enumerate(data_sets):
            ax.plot(x, d, c=colors[dsi], alpha=alpha[dsi])
        ax.set_xlim([x[i], x[i+1]])
        
    # Set the x axis ticks 
    for dimension, (axx,xx) in enumerate(zip(axes, x[:-1])):
        axx.xaxis.set_major_locator(ticker.FixedLocator([xx]))
        ticks = len(axx.get_yticklabels())
        labels = list()
        step = min_max_range[dimension][2] / (ticks - 3)
        mn   = min_max_range[dimension][0]
        for i in range(-1,ticks):
            v = mn + i*step
            labels.append('%6.2f' % v) 
        axx.set_yticklabels(labels)


    # Move the final axis' ticks to the right-hand side
    axx = plt.twinx(axes[-1])
    dimension += 1
    axx.xaxis.set_major_locator(ticker.FixedLocator([x[-2], x[-1]]))
    ticks = len(axx.get_yticklabels())
    step = min_max_range[dimension][2] / (ticks - 1)
    mn   = min_max_range[dimension][0]
    labels = ['%6.2f' % (mn + i*step) for i in range(ticks)]
    axx.set_yticklabels(labels)      
    
    i=0
    for col in columNames[:-2]:
        plt.sca(axes[i])
        plt.xticks([i], (col,), rotation = 'vertical')
        i+=1
    plt.sca(axes[i])
    plt.xticks([i,i+1], columNames[i:],  rotation = 'vertical')
    
    #color labels
    plt.plot([],[],color='g',label='CEGO')
    plt.plot([],[],color='r',label='MOGA')
    plt.plot([],[],color='b',label='NSGAII')
    plt.plot([],[],color='k',label='SPEA2')
    #delete whitespace
    plt.subplots_adjust(wspace=0)
    
    #title
    plt.suptitle('WP')
    
    plt.legend(bbox_to_anchor=(1.9, 1), loc=2, borderaxespad=0.)
    fig.savefig("WP.pdf",dpi=600,bbox_inches='tight') 
    #fig.savefig("paralelcoordinate")
    
